import React from 'react';
import Logo from '../Logo/Logo';
import './Navigation.css';

const Navigation = ({onRouteChange}) => {
	return (
		<nav>
			<Logo />
			<p onClick={() => onRouteChange('signin')} className="SignOut">Sign Out</p>
		</nav>
	);
}

export default Navigation
